import React from 'react';
import logo from './logo.svg';
import './App.css';
import {GoogleMap,withScriptjs,withGoogleMap,Marker} from "react-google-maps";


function Map()
{
  return <GoogleMap defaultZoom={10} defaultCenter={{lat:45.4211,lng:-75.6903}}/>;
}
const WrappedMap=withScriptjs(withGoogleMap(Map));
function App() {
  return (

    <div style={{width:'100vw',height:'100vh'}}className="App">
      <WrappedMap googleMapURL={`https://maps.googleapis.com/maps/api/js?v=3.exp&libraries=geometry,drawing,places&key=AIzaSyC-bxoipOpE8IMUOVP39DEClzZwLDVKXWI`}
      loadingElement={<div style={{height:"100%"}}/>}
      containerElement={<div style={{height:"100%"}}/>}
      mapElement={<div style={{height:"100%"}}/>}

      />
    </div>
  );
}

export default App;
